using Autofac.Extras.Moq;
using System.Text.Json;
using VueFormsApi.Controllers;
using VueFormsApi.DataStructureHelpers;
using VueFormsApi.DataStructures;
using VueFormsApi.DataStructures.MallStructures;
using Xunit;

namespace VueFormsApi.Tests
{
    public class SearchTests
    {
        [Fact]
        public async Task LoadAllOwners()
        {
            using var mock = AutoMock.GetLoose();
            mock.Mock<IMall>()
                .Setup(x => x.GetStores())
                .Returns(GetSampleStores()!);

            var cls = mock.Create<VueFormsController>();

            var expected = OwnerHelper.LoadOwners(GetSampleStores());

            var actual = await cls.LoadAllOwnersAsync();

            Assert.True(actual != null);
            Assert.Equal(expected.Count, actual.Count);
        }

        [Theory]
        [InlineData("Lipatov", 1)]
        [InlineData("Russia; litvinov", 3)]
        [InlineData("Russia", 3)]
        [InlineData("male; Russia; litvinov; lipatov;lipatov@mail.ru", 4)]
        [InlineData("United States", 1)]
        public async Task SearchInclusevly(string query, int expectedResultCount)
        {
            using var mock = AutoMock.GetLoose();
            mock.Mock<IMall>()
                .Setup(x => x.GetStores())
                .Returns(GetSampleStores()!);

            var cls = mock.Create<VueFormsController>();

            var actual = await cls.InclusiveSearchAsync(query);

            Assert.Equal(actual.Count, expectedResultCount);
        }

        [Theory]
        [InlineData("Lipatov", 1)]
        [InlineData("Russia; litvinov", 1)]
        [InlineData("Russia", 3)]
        [InlineData("male; Russia; litvinov; lipatov;lipatov@mail.ru", 0)]
        [InlineData("United States", 1)]
        [InlineData("Russia;female", 0)]
        [InlineData("male", 4)]
        public async Task SearchExclusevly(string query, int expectedResultCount)
        {
            using var mock = AutoMock.GetLoose();
            mock.Mock<IMall>()
                .Setup(x => x.GetStores())
                .Returns(GetSampleStores()!);

            var cls = mock.Create<VueFormsController>();

            var actual = await cls.ExclusiveSearchAsync(query);

            Assert.Equal(actual.Count, expectedResultCount);
        }

